import React from 'react';
import {Link} from "react-router-dom"; 

const Anime = ({id, title}) => {
    return (
        <Link to={`/${id}`}>
            <div className="grid">
                <div className="grid-item">
                    <div className="title">
                        {title}
                    </div>
                </div>
            </div>

        </Link>
    )
}

export default Anime;
